import { useEffect, useState } from "react";

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    // Gọi API backend
    fetch("/hello")  // do proxy đã cấu hình, sẽ tới http://localhost:8080/hello
      .then(res => res.text())  // nếu backend trả text, dùng res.json() nếu JSON
      .then(data => setMessage(data))
      .catch(err => console.error("Error:", err));
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Frontend React kết nối Backend Java</h1>
      <p>Response từ backend: {message}</p>
    </div>
  );
}

export default App;
